import React from 'react'
import { View, Text } from 'react-native'
import { StatusBar } from "react-native";

const NavBar = () => {
  return (
    <View>
        <StatusBar>

        </StatusBar>
        <Text style= {{ color: 'white', flex: 1, marginTop: 10, backgroundColor: 'green'}}>Soy el navbar</Text>
    </View>
  )
}

export default NavBar
